syntax = "proto3";

package deliveryApi.grpc2;

option csharp_namespace = "deliveryApi.grpc2";

import "google/protobuf/timestamp.proto";

message HealthStatusModel {
	repeated string surrogateKeys = 1;
	string status = 2;
	string version = 3;
	.google.protobuf.Timestamp released_at = 4;
	string environment = 5;
	string slot = 6;
}